import React from 'react'
import Navbar from '../components/widgets/Navbar';
import '../App.css'

const designTiles={
    width: '40%',
    height: 'auto',
}

const folderTile={
    width: '30%',
}

class Miscellaneous extends React.Component{
    render(){
        return(
            <div className='MainPage'>
                <Navbar />
                <div>
                    <div>
                        MISCELLANEOUS
                    </div>
                    <div className='pageStyles'>
                        Random graphic designs projects I've worked on :)
                        <div style={{display: 'block'}}>
                            <div style={{designTiles}}>
                                <img src={require('../components/images/misc/Gazette.jpg')} alt='Gazette' style={designTiles}/>
                                <p>HAHAHA</p>
                            </div>
                            <div>
                                <img src={require('../components/images/misc/SilverJubilee.jpg')} alt='Silver Jubilee' style={designTiles} />                                
                            </div>
                            <div>
                                <img src={require('../components/images/misc/GDOPoster.png')} alt='GDO Poster' style={designTiles}/>
                            </div>
                            <div>
                                <img src={require('../components/images/misc/ShadowDay.jpg')} alt='Shadow Day' style={designTiles}/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Miscellaneous;
